import { useEffect, useState } from 'react';
import './App.css';
import GetGifs from './services/getGifs';

function App() {

  const [gifs, setGifs] = useState([])

  useEffect(()=>{
  GetGifs()
  .then((gifs => setGifs(gifs)))


  },[])




  return (
    <div className="App">
      <header className="App-content">


     <button> boton </button>

      </header>
    </div>
  );
}

export default App;
